    /* campaigns */
    this.addRoute('/register', 'post', UsersController, 'register');
    this.addRoute('/login', 'post', UsersController, 'authenticate');
    return this.routes;
  }

  // Secured router list those required jWT Token Authorization.
  // getSecuredRoutes() {
