import bcrypt, { hashSync } from 'bcrypt';

import BaseRepository from 'repositories/BaseRepository';

class UserRepository extends BaseRepository {
  constructor(db, logger) {
    super();
    this.logger = logger;
    this.usersCollection = db.collection('users');
  }

  async createUser(data) {
    try {
      const { username, password } = data;

      const userSnapshot = await this.usersCollection
        .where('username', '==', username)
        .limit(1)
        .get();

      if (!userSnapshot.empty) {
        return { statusCode: 200, message: 'User already Exists' };
      }

      const paswordHash = hashSync(password, 10);
      await this.usersCollection.add({ username, password: paswordHash });
      return { statusCode: 201, message: 'User Created Successfully' };
    } catch (err) {
      this.logger.error(err);
    }
  }

  async authenticate(data, secret) {
    try {
      const { username, password } = data;
      let userSnapshot = await this.usersCollection.where('username', '==', username).get();

      if (userSnapshot.empty) {
        return { statusCode: 200, message: 'User Not Found' };
      }
      console.log('***** total users found *****', userSnapshot.docs.length, secret);
      for (const doc of userSnapshot.docs) {
        const comparePass = bcrypt.compareSync(password, doc.data().password);
        if (!comparePass) {
          return { statusCode: 200, message: 'username / password incorrect!' };
        }
      }
      return;
      // let`s test if the password is valid
      // userSnapshot.docs.forEach((doc) => {
      //   const comparePass = bcrypt.compareSync(password, doc.data().password);
      //   if (comparePass) {
      //     return { statusCode: 200, message: 'username / password incorrect!' };
      //   } else {
      //     return { statusCode: 200, message: 'username / password incorrect!' };
      //   }
      // });
    } catch (err) {
      this.logger.error(err);
    }
  }
}

export default UserRepository;

