    let uriParam = uri;
    const replacedParams = [];

    while ((match = /:([\w_]+)\??/gi.exec(uriParam))) {
      replacement = params[match[1]].toString() || '';
      if (replacement === '') {
        uriParam = uriParam.replace(`/${match[0]}`, '');
