    routeData.action = action;

    if (!RoutesCollection[controller.name]) {
      RoutesCollection[controller.name] = {};
    }

    RoutesCollection[controller.name] = {
      ...RoutesCollection[controller.name],
      [action]: routeData,
    };
  }
}

