import BaseRepository from 'repositories/BaseRepository';

class SettingRepository extends BaseRepository {
  constructor(db, logger) {
    super();
    this.logger = logger;
    this.db = db;
    this.parkingLotSettingsCollection = db.collection('parkingLotSettings');
  }

  async create(data) {
    try {
      const { name, totalSlots } = data;

      const slotSnapshot = await this.parkingLotSettingsCollection
        .where('name', '==', name)
        .where('totalSlots', '==', totalSlots)
        .limit(1)
        .get();

      if (!slotSnapshot.empty) {
        return { statusCode: 200, message: 'User already Exists' };
      }

      const paswordHash = hashSync(password, 10);
      await this.usersCollection.add({ username, password: paswordHash });
      return { statusCode: 201, message: 'User Created Successfully' };
    } catch (err) {
      this.logger.error(err);
    }
  }
}

