import redis from 'redis';
import { isNull } from 'lodash';

module.exports = (key) => (req, res, next) => {
  const redisHost =
    process.env.NODE_ENV === 'production' ? 'redis://redis:6379' : '//localhost:6379';
  // const client = redis.createClient(process.env.REDIS_PORT || 6379);
  const client = redis.createClient(redisHost);

  if (!isNull(key)) {
    client.get(key, (err, data) => {
      if (err) next(err);
      if (!isNull(data)) {
        let obj = { [key]: parseInt(data) };
        res.send({ status: 'success', ...obj });
      } else {
        next();
      }
    });
  } else {
    next();
  }
};

